import styles from './ListOfThings.module.css';

const ListOfThings = ({things}) => (
    <div className={styles.container}>
        {things.map((thing, index) => (
            <h3 key={index}>{thing}</h3>
        ))}
    </div>
);

export default ListOfThings;
